import { createSlice } from "@reduxjs/toolkit";

const keysInitialState = { keys: [] };

const keysSlice = createSlice({
  name: "keys",
  initialState: keysInitialState,
  reducers: {
    addKey(state, action) {
      state.keys = [action.payload, ...state.keys];
    },
  },
});

export default keysSlice.reducer;
